import axios from "axios";
import React, { useState, useEffect } from "react";
import { useParams, NavLink } from "react-router-dom";
import style from "../StudentDashboard.module.css";
import baseUrl from "../../../baseUrl";

function Exam() {
  let { category } = useParams();

  const [allExam, setAllExam] = useState([]);

  useEffect(() => {
    async function getAllExams() {
      let value = await axios.get(`${baseUrl}/exam`);
      setAllExam(value.data);
    }
    getAllExams();
  }, []);

  return (
    <>
      <div className={`container ${style.displayBoxHeadingBox}`}>
        <h1>All {category} Exams</h1>
      </div>
      <div className={`container ${style.examContainer}`}>
        {allExam.map((data, i) => {
          if (data.name.name === category) {
            return (
              <div className={`card ${style.displayBoxExamBox}`} key={i}>
                <div className={style.cardBody}>
                  <h5 className="card-title">{data.name.name}</h5>
                  <p className="card-text">Exam ID: {data.id}</p>
                  <p className="card-text">Exam Description: {data.desc}</p>
                  <p className="card-text">Pass Marks: {data.passMarks}</p>
                  <p className="card-text">Total Marks: {data.marks}</p>
                  <NavLink
                    exact
                    to={`/StudentDashboard/Exam/Math/${data.id}`}
                    className="btn btn-primary"
                  >
                    Go to Exam
                  </NavLink>
                </div>
              </div>
            );
          }
          return null;
        })}
      </div>
    </>
  );
}

export default Exam;
